import React, { Fragment } from "react";
import { Menu } from "antd";
import "./style.css";

export default (props) => {
    const {menuData} = props;
  return (
    <Fragment>
      <div className="head">
        <Menu mode="horizontal" defaultSelectedKeys={['1']}>
          {
              menuData.map((item) => <Menu.Item key="1">首页</Menu.Item>)
          }
        </Menu>
      </div>
    </Fragment>
  );
};
